

from __future__ import annotations

import math

import torch


def hadamard_transform(x: torch.Tensor, *, transpose: bool = False) -> torch.Tensor:
    """Apply the (possibly transposed) structured Hadamard matrix to the last dimension of ``x``.

    This implements the fast Walshâ€“Hadamard transform. The routine works in two
    phases:

    1. A radix-2 butterfly that reduces the transform to blocks of size ``K`` determined by
       :func:`get_hadK`.
    2. An optional dense multiplication by the precomputed Hadamard block when ``K > 1``.

    Args:
        x: Input tensor. The final dimension is transformed in-place; earlier dimensions are treated
            as batch dimensions.
        transpose: If ``True``, apply the transpose of the Hadamard matrix.

    Returns:
        Tensor with the same shape as ``x`` containing the scaled Hadamard transform results.
    """

    if x.ndim == 0:
        raise ValueError("Hadamard transform requires at least one dimension.")

    n: int = x.shape[-1]
    had_block, block_size = get_hadK(n, transpose)

    if not x.is_contiguous():
        raise ValueError("Hadamard transform requires contiguous inputs for view-based flattening.")

    batch = x.view(-1, n)
    batch_size: int = batch.shape[0]

    # Iterative radix-2 butterflies collapse the transform down to block_size chunks.
    working = batch.unsqueeze(-1)
    segment_count = n
    segment_width = 1

    while segment_count > block_size:
        # Reshape into (batch, pairs, 2, width) so we can add/subtract adjacent halves.
        view = working.view(batch_size, segment_count // 2, 2, segment_width)
        low = view[:, :, 0, :]
        high = view[:, :, 1, :]
        combined = torch.cat((low + high, low - high), dim=-1)

        segment_count //= 2
        segment_width *= 2
        working = combined.reshape(batch_size, segment_count, segment_width)

    # Multiply by the pre-computed Hadamard block if one is supplied.
    if had_block is not None and block_size > 1:
        hadamard = had_block.to(device=working.device, dtype=working.dtype)
        working = torch.bmm(hadamard.expand(batch_size, -1, -1), working)

    transformed = working.view(batch_size, n) / math.sqrt(n)
    return transformed.view_as(x)


# Rest taken from quip-sharp

def ref_hadamard_transform(X, transpose=False):
    n = X.shape[-1]
    hadK, K = get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2,
                           input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output
    utils.clean()
    if K > 1:
        input = torch.bmm(
            hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype),
            input)
    return input.view(X.shape) / torch.tensor(n).sqrt()


def get_hadK(n, transpose=False):
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert (is_pow2(n // 172))
        K = 172
        hadK = get_had172().T if transpose else get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert (is_pow2(n // 156))
        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert (is_pow2(n // 140))
        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 124 == 0:  # falcon 180b
        assert (is_pow2(n // 124))
        K = 124
        hadK = get_had124().T if transpose else get_had124()
    elif n % 116 == 0:  # falcon 180b
        assert (is_pow2(n // 116))
        K = 116
        hadK = get_had116().T if transpose else get_had116()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert (is_pow2(n // 108))
        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert (is_pow2(n // 60))
        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert (is_pow2(n // 52))
        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert (is_pow2(n // 36))
        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:
        assert (is_pow2(n // 28))
        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 20 == 0:
        assert (is_pow2(n // 20))
        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert (is_pow2(n // 12))
        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert (is_pow2(n))
        K = 1

    return hadK, K


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


